	mi_DPsi.at(24) = 0.03515625 * (-9. * Point[0] * Point[0] * Point[0] + 9. * Point[0] * Point[0] + Point[0] - 1.) * (-9. * Point[1] * Point[1] - 2. * Point[1] + 3.);
